import React from "react";
import MyTacos from "./MyTacos";
import { Switch, Route } from "react-router-dom";
import { ContextProvider } from "./components/Mycontext";
import { Viandes, Sauces, Extra } from "./components/Themenu";

const App = () => {
  return (
    <ContextProvider>
      <Switch>
        <div className="bg-gray-800 h-screen flex items-center justify-center mx-auto ">
          <Route exact path="/" component={MyTacos} />
          <Route exact path="/viande" component={Viandes} />
          <Route exact path="/sauces" component={Sauces} />
          <Route exact path="/extra" component={Extra} />
        </div>
      </Switch>
    </ContextProvider>
  );
};

export default App;
